import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#2196F3', // Change the primary color
    },
    secondary: {
      main: '#f50057', // Change the secondary color
    },
  },
});

export default theme;
